import React, { Component } from 'react'

export default class Nav extends Component {
  render() {

    let i = 0
   

    return (

      
      
      <div className='rumb'>
        <img src='minesweeper.png' alt=''></img>
        Iskzbane mtadrutyun e exel unenal Морской бой (Sea Battle) xaxy bayc npatakaharmar er stanal minesweeper xaxy
        arajikayum klini nor barelavummner xaxum


        <div className='xaxiMasin'>Rumbnery 21 hat en ete gtnes dranq 55 porcic uremn du haxtel es isk rumbnery gtnelu hamar uxxaki sexmir ayn vandaki vra vory karcum es gaxtniq uni BARI XAX   </div>
      </div>

        
    )
  }
}





